import React, {Component} from 'react';
import './App.css';

const { Device } = require('twilio-client');

class App extends Component {
  constructor(props) {
    super(props)

    this.state={
      //name that will eventually be assigned to the Twilio Device
      identity: '',
      //which is the connection/call status of the device
      status: '',
      //indicating whether or not the device is able to make or receive a call
      ready: false
    }
  }
}

export default App;
